import { ListOfGoals } from "../ApiManager"

export const GoalList = () => {
  const [goallist, setGoalList] = useState([]);

      useEffect(
         () => {
            ListOfGoals()
            .then((data) => {
               setGoalList(data)
               console.log(data)
            })
         }, []
      )



  return (
     <>
     <h1>Goal List</h1>

      {
         goallist.map((goal) => {
            return <div key={goal.id}>{goal.goalDescription}</div>
         })
      }


    </>
  );
};
